INSERT INTO public."Trips" VALUES ('81faae2f-63ed-4c8b-85b3-740bf729d4a5', 'df790517-7517-4172-aeb1-af0de8d1acf3', NULL, NULL, false, 'Hành Trình Về Nguồn Đất Tổ', 'Ho Chi Minh City', '106.62966379999999', '10.8230989', 'Đền Hùng - Di Tích Cội Nguồn Dân Tộc Việt Nam', '105.3255046', NULL, '21.3684539', 'Hành Trình Về Nguồn Đất Tổ là khoảnh khắc để chúng ta quay lại nơi cội nguồn dân tộc. Trong không khí linh thiêng, chúng ta nhớ rằng tuổi trẻ không chỉ đi để vui — mà đi để hiểu, để biết mình thuộc về đâu.', 'Draft', 3, 10, NULL, NULL, NULL, '2025-12-06 01:57:12.710035+07', '2025-12-06 01:57:12.710032+07', NULL);
INSERT INTO public."Trips" VALUES ('e7849579-130f-4fda-83f1-12c36f423fe0', 'df790517-7517-4172-aeb1-af0de8d1acf3', NULL, NULL, false, 'Hành Trình Truy Tìm Bình Yên Phan Thiết-Mũi Né', 'Mien Dong Bus Station', '106.71093990000001', '10.8158355', 'Mũi Né', '108.2871626', '10.933375', NULL, 'Hành Trình Truy Tìm Bình Yên Phan Thiết là chuyến đi cho những ai muốn nhìn hoàng hôn buông xuống trên đồi cát đỏ rực, nghe tiếng gió hoang hoải thổi qua những hàng dừa. Chuyến xe khởi hành sớm mang theo khát vọng khám phá miền biển đầy nắng và đầy gió.', 'Draft', 2, 6, NULL, NULL, NULL, '2025-12-06 01:46:08.407295+07', '2025-12-06 01:46:08.407279+07', NULL);
INSERT INTO public."Trips" VALUES ('86d98cca-5c49-4e8c-98db-9fb0dd04d8d6', '73098bfc-daf7-415b-b69e-57b460c0bd9b', NULL, NULL, false, 'Đêm Trăng Trên Hồ Ba Bể', 'Bến xe Mỹ Đình', '105.77734249999999', '21.028488199999998', 'Ba Be Lake View Homestay', '105.63705949999999', '22.388584899999998', NULL, 'Một đêm bên hồ lớn nhất Việt Nam, khi trăng soi mặt nước như tấm gương khổng lồ. Kayaking trong màn đêm, nghe tiếng côn trùng và hương rừng là trải nghiệm mang tính trị liệu hiếm có.', 'Draft', 8, 16, NULL, NULL, NULL, '2025-12-06 03:09:10.280438+07', '2025-12-06 03:09:10.280435+07', NULL);
INSERT INTO public."Trips" VALUES ('f73cf959-eea3-4eef-adf9-217d71e48172', '73098bfc-daf7-415b-b69e-57b460c0bd9b', NULL, NULL, false, 'Vi Vu Hà Giang – Đỉnh Thử Thách Mã Pí Lèng', 'Bến xe Mỹ Đình', '105.77734249999999', '21.028488199999998', 'Mã Pí Lèng', '105.42438039999999', '23.2356473', NULL, 'Hà Giang là câu chuyện của những vách đá, mây ngang tầm mắt và cảm giác đứng giữa trời đất bao la. Mã Pí Lèng là thử thách không chỉ của tay lái mà còn là của tinh thần.', 'Draft', 8, 16, NULL, NULL, NULL, '2025-12-06 03:10:25.353123+07', '2025-12-06 03:10:25.353109+07', NULL);
INSERT INTO public."Trips" VALUES ('74a7727b-d256-46aa-8e3b-c04f05b16809', '73098bfc-daf7-415b-b69e-57b460c0bd9b', NULL, NULL, false, 'Tam Đảo Săn Mây – Ngày Không Công Nghệ', 'Bến xe Mỹ Đình', '105.77734249999999', '21.028488199999998', 'Tam đảo Vĩnh Phúc Việt Nam', '105.6441852', '21.453230200000004', NULL, 'Ngồi ở quán cà phê cao nhất, mây trôi ngang mắt, không cần filter vẫn đẹp. Một ngày bỏ xa mạng xã hội, để cơ thể reset và đầu óc thảnh thơi.', 'Draft', 8, 16, NULL, NULL, NULL, '2025-12-06 03:11:47.828879+07', '2025-12-06 03:11:47.828863+07', NULL);
INSERT INTO public."Trips" VALUES ('816be859-1d7c-41e7-bf2a-08d7cb23e838', '73098bfc-daf7-415b-b69e-57b460c0bd9b', NULL, NULL, false, 'Yên Tử – Đường Thiền Trong Sương', 'Bến xe Mỹ Đình', '105.77734249999999', '21.028488199999998', 'Yen Tu Mountain', '106.71501429999999', '21.160921', NULL, 'Leo qua những bậc đá cổ, đi trong rừng trúc và sương mù huyền ảo. Một chuyến đi chữa lành, nhìn lại bản thân, để hiểu vì sao có người gọi Yên Tử là “đường lên trời”.', 'Draft', 8, 16, NULL, NULL, NULL, '2025-12-06 03:13:55.172128+07', '2025-12-06 03:13:55.172109+07', NULL);
INSERT INTO public."Trips" VALUES ('c0f3877d-b20a-447a-9b80-8331eb5ed674', '73098bfc-daf7-415b-b69e-57b460c0bd9b', NULL, NULL, false, 'Cửa Lò – Biển Ăn Niềm Vui', 'Bến xe Mỹ Đình', '105.77734249999999', '21.028488199999998', 'Cua Lo Beach', '105.7486874', '18.7784704', NULL, 'Biển xanh, đồ ăn ngập bàn và trò chơi bãi biển. Đây là hành trình xã stress đúng nghĩa “ăn cười no bụng”.', 'Draft', 8, 20, NULL, NULL, NULL, '2025-12-06 03:15:27.087467+07', '2025-12-06 03:15:27.08746+07', NULL);
INSERT INTO public."Trips" VALUES ('398b7598-f31c-431b-86e7-0a07e8976434', 'df790517-7517-4172-aeb1-af0de8d1acf3', NULL, NULL, false, 'Hành Trình Sống Chậm Hội An', 'Mien Dong Bus Station', NULL, NULL, 'Hoi An ancient town', NULL, NULL, NULL, 'Hành Trình Sống Chậm Hội An là lời mời dành cho những ai đã quá mệt với nhịp sống ồn ã. Đèn lồng, mái ngói rêu phong, phố cổ yên bình — chuyến đi sẽ giúp tâm trí được thảnh thơi, để những câu chuyện cũ có thời gian kể lại.', 'Draft', 2, 6, NULL, NULL, NULL, '2025-12-06 01:52:23.769491+07', '2025-12-06 01:52:23.769474+07', NULL);
INSERT INTO public."Trips" VALUES ('cda6430f-2033-4359-9aad-9fd19c075006', 'df790517-7517-4172-aeb1-af0de8d1acf3', NULL, NULL, false, 'Hành Trình Huyền Ảo Đảo Ngọc Phú Quốc', 'Ho Chi Minh City', NULL, NULL, 'Phú Quốc International Airport', NULL, NULL, NULL, 'Hành Trình Huyền Ảo Đảo Ngọc đưa chúng ta rời Sài Gòn khi trời tối, để bình minh mở ra trên mặt biển mênh mông. Đắm mình trong nước xanh, ngắm san hô, thưởng hải sản… Mỗi khoảnh khắc đều như một món quà của tự nhiên.', 'Draft', 3, 10, NULL, NULL, NULL, '2025-12-06 01:53:21.823859+07', '2025-12-06 01:53:21.823849+07', NULL);
INSERT INTO public."Trips" VALUES ('07384e47-2d07-4bfa-9aaa-d65b31762794', 'df790517-7517-4172-aeb1-af0de8d1acf3', NULL, NULL, false, 'Hành Trình Biển Gọi Vũng Tàu', 'Mien Dong Bus Station', '106.71093990000001', '10.8158355', 'Vũng Tàu', '107.136224', '10.4113797', NULL, 'Hành Trình Biển Gọi Vũng Tàu dành cho những người trẻ yêu biển, muốn rũ bỏ hơi nóng ngột ngạt của Sài Gòn để đón làn gió mặn và tiếng sóng vỗ rì rầm. Chúng ta rời phố thị lúc trời còn mờ sương, mong chờ buổi sáng dạo biển, nô đùa dưới nắng và tìm chút bình yên giữa tiếng sóng và cát mềm dưới chân.', 'Published', 2, 5, NULL, NULL, NULL, '2025-12-06 01:33:12.173991+07', '2025-12-06 01:33:12.173696+07', NULL);
INSERT INTO public."Trips" VALUES ('09d1dac4-b35b-4cf1-9469-ea020385b9f3', '73098bfc-daf7-415b-b69e-57b460c0bd9b', NULL, NULL, false, 'Lúa Chín Mù Cang Chải', 'Bến xe Mỹ Đình', '105.77734249999999', '21.028488199999998', 'Mù Cang Chải District', '104.14660459999999', '21.7670046', NULL, 'Hành trình đi giữa những bậc thang vàng óng mùa lúa chín, không khí trong trẻo, cảm giác như đi vào bức tranh sơn mài của thiên nhiên. Đây là chuyến đi để sống chậm, để những shot flycam kể câu chuyện thay lời nói.', 'Published', 8, 20, NULL, NULL, NULL, '2025-12-06 03:07:19.84867+07', '2025-12-06 03:07:19.84866+07', NULL);
INSERT INTO public."Trips" VALUES ('553df8da-697a-49fb-a4de-41bd74d512d3', '73098bfc-daf7-415b-b69e-57b460c0bd9b', NULL, NULL, false, 'Tràng An – Miền Sơn Thuỷ Huyền Ảo', 'Bến xe Mỹ Đình', '105.77734249999999', '21.028488199999998', 'Tràng An', '105.9624837', '20.2633513', NULL, 'Thuyền trôi giữa núi đá vôi hàng triệu năm, hang xuyên nước và tiếng mái chèo nhẹ. Một cuốn phim fantasy Việt Nam, chỉ là bạn đang ngồi bên trong nó.', 'Draft', 8, 20, NULL, NULL, NULL, '2025-12-06 03:18:21.115988+07', '2025-12-06 03:18:21.115982+07', NULL);
INSERT INTO public."Trips" VALUES ('1776f71c-d5f0-4dbf-a25c-976880a1f583', 'df790517-7517-4172-aeb1-af0de8d1acf3', NULL, NULL, false, 'Hành Trình Cao Nguyên Gió Buôn Ma Thuột', 'Ho Chi Minh City', NULL, NULL, 'Buon Ma Thuot', NULL, NULL, NULL, 'Hành Trình Cao Nguyên Gió dành cho những tâm hồn thích sự hoang sơ của núi rừng. Chúng ta rời Sài Gòn trong bóng tối, để đón ánh nắng đầu tiên trên những nương cà phê bạt ngàn, thưởng vị cà phê nguyên bản giữa đại ngàn và nghe tiếng suối rì rào như một bản nhạc của tự nhiên.', 'Draft', 2, 6, NULL, NULL, NULL, '2025-12-06 01:50:39.689041+07', '2025-12-06 01:50:39.689035+07', NULL);
INSERT INTO public."Trips" VALUES ('091f871c-f4f8-4009-8fdf-584a6e31d414', 'df790517-7517-4172-aeb1-af0de8d1acf3', NULL, NULL, false, 'Hành Trình Chạm Tới Cực Nam – Cà Mau', 'Mien Dong Bus Station', '106.71093990000001', '10.8158355', 'Cà Mau', '105.1960795', '9.1526728', NULL, 'Hành Trình Chạm Tới Cực Nam là chuyến đi để khám phá nơi tận cùng Tổ quốc. Khởi hành khi thành phố còn say ngủ, chúng ta đi tìm cảm giác nhìn về biển lớn – nơi đất trời như hòa làm một.', 'Published', 4, 12, NULL, NULL, NULL, '2025-12-06 01:57:44.397902+07', '2025-12-06 01:57:44.397897+07', NULL);
INSERT INTO public."Trips" VALUES ('097b6315-9e60-46c4-a696-82e6b9f33aa1', 'df790517-7517-4172-aeb1-af0de8d1acf3', NULL, NULL, false, 'Hành Trình Dọc Miền Cát Trắng Bình Thuận', 'Ho Chi Minh City', NULL, NULL, 'Beach Co Thach', NULL, NULL, NULL, 'Hành Trình Dọc Miền Cát Trắng là chuỗi trải nghiệm nơi biển ôm lấy sa mạc, nơi nắng trải dài vô tận. Những bãi đá bảy màu và tiếng sóng vỗ không ngừng sẽ tạo nên một câu chuyện độc đáo của tuổi trẻ.', 'Published', 3, 10, NULL, NULL, NULL, '2025-12-06 01:54:18.068661+07', '2025-12-06 01:54:18.068654+07', NULL);
